import React, { useState } from 'react';
import './Started.css';
import logo from './logo.png'; // Патеката до логото
import Login from './Login'; // Импорт на Login компонентата

function Started() {
  const [showLogin, setShowLogin] = useState(false);

  const handleLoginClick = () => {
    setShowLogin(true);
  };

  return (
    <div className="started">
      <header className="started-header">
        <img src={logo} alt="Your App Name" className="logo" />
      </header>
      <main className="started-main">
        <h1>Welcome to CheckInn</h1>
        <div className="buttons">
          <button className="button login" onClick={handleLoginClick}>Login</button>
          <button className="button signup">Sign Up</button>
        </div>
        {showLogin && <Login />} {/* Прикажи ја Login компонентата */}
      </main>
    </div>
  );
}

export default Started;
